import React from 'react';
import ReactDOM from 'react-dom/client';

const App = () => {
    return <div>
      Hello World
    </div>
}

const root = ReactDOM.createRoot(document.getElementById('app'));
root.render(
    <BrowserRouter>
    <App/>
    </BrowserRouter>
) 


ReactDOM.render(
  <App />,
  document.getElementById('app'),
);
